import React from "react";
import { useState } from "react";
import { Component } from "react";

class App extends Component{

constructor(){
    super()

    const [stater,setStater]=useState(0)

}


render(){

    return(
        <>
        <button onClick={()=> setStater(stater++)}>Click Here</button>
        <p>{ stater}</p>
        </>
    )

}
}
export default App
    
